
const imageSrc = `data:image/jpeg;base64,`;
const img = new Image();
img.src = imageSrc;
const ctx = canvas.getContext("2d");

img.onload = _ =>{

	canvas.width = img.width;
	canvas.height = img.height;
	const update = _=>{

		const scale = 1.5;
		const center = {
			x: (canvas.width/2) - ((img.width+(scale * 100))/2),
			y: (canvas.height/2) - ((img.height+(scale * 100))/2)
		};
		ctx.drawImage(img,center.x,center.y,img.width+(scale * 100),img.height+(scale * 100));
		const imageData = ctx.getImageData(0,0,canvas.width,canvas.height);

		function calculateBrightness(red,green,blue){
			return Math.sqrt(
				(0.299 * (red**2)) + 
				(0.587 * (green**2)) + 
				(0.114 * (blue**2))
			) / 100;
		}

		const row = [];
		for(let y = 0; y < canvas.height; y++){
			let col = [];
			for(let x = 0; x < canvas.width; x++){
				const red = imageData.data[(y * 4 * imageData.width) + (x * 4)]
				const green = imageData.data[(y * 4 * imageData.width) + (x * 4 + 1)]
				const blue = imageData.data[(y * 4 * imageData.width) + (x * 4 + 2)]
				const alpha = calculateBrightness(red,green,blue);
				col.push({
					a: alpha,
					r: red,
					g: green,
					b: blue
				});
			}
			row.push(col);
		}

		const particles = [];
		const SIZE_OF_PARTICLES = 2000;

		class Particle{
			constructor(){
				this.x = Math.random() * canvas.width;
				this.y = 0;
				this.speed = Math.random() * 1.5;
				this.velocity = Math.random() * 0.5;
				this.r = Math.random() * 10;
				this.color = "white";
				this.dy = 0;
			}

			update(){
				const g = row[Math.floor(this.y)][Math.floor(this.x)];
				this.color = `rgb(${g.r},${g.g},${g.b},${g.a})`;
				this.y+= this.speed;
				this.x+= Math.sin(this.speed);
				if(this.x >= canvas.width){
					this.x = 0;
					this.y = Math.random() * canvas.height;
				}
				if(this.y >= canvas.height){
					this.y = 0;
					this.x = Math.random() * canvas.width;
				}

			}

			draw(){
				ctx.beginPath();
				ctx.fillStyle = this.color;
				ctx.arc(this.x,this.y,this.r,0,Math.PI * 2, true);
				ctx.fill();
			}
		}

		for(let g = 0; g < SIZE_OF_PARTICLES; g++){
			particles.push(new Particle);
		}

		function animation(){
			ctx.fillStyle = "rgba(0,0,0,0.05)";
			ctx.fillRect(0,0,canvas.width,canvas.height);
			for(let g of particles){
				g.update();
				g.draw();
			}
			requestAnimationFrame(animation);
		}

		animation();

	}

	update();

}
